const (
	// FpRegistryID is the ID of FpRegistry
	FpRegistryID = "0000000000000009"
	// FpRegistryBinary is the binary code of FpRegistry
	FpRegistryBinary = ""
	// CdpManageID is the ID of CdpManage
	CdpManageID = "0000000000000010"
	// CdpManageBinary is the binary code of CdpManage
	CdpManageBinary = ""
	// ManageID is the ID of Manage
	ManageID = "0000000000000011"
	// ManageBinary is the binary code of Manage
	ManageBinary = ""
	// ManageProxyID is the ID of ManageProxy
	ManageProxyID = "0000000000000012"
	// ManageProxyBinary is the binary code of ManageProxy
	ManageProxyBinary = ""
	// EapStorageID is the ID of EapStorage
	EapStorageID = "0000000000000013"
	// EapStorageBinary is the binary code of EapStorage
	EapStorageBinary = ""
	// TokenRiskLockID is the ID of TokenRiskLock
	TokenRiskLockID = "0000000000000014"
	// TokenRiskLockBinary is the binary code of TokenRiskLock
	TokenRiskLockBinary = ""
	// StartFpTokenID is the ID of StartFpToken
	StartFpTokenID = "00000000000000015"
)

type (
	// FpToken is an interface for an fp token
	FpToken interface {
		Contract
		CreateToken(string, string, string, int64, int64, int64, int64) (string, error)
		CreateDeferredToken(string, string, string, string, int64, int64, int64) (string, error)
		TokenAddress(string) (string, error)
		Transfer(string, string, string, string, int64) (string, error)
		RiskLock(string, string, string, int64) (string, error)
		SetRate(string, int64) (string, error)
		GetRate(string) (string, error)
		SetPayDate(string, int64) (string, error)
		GetPayDate(string) (string, error)

		SetManagement(string) FpToken
		SetManagementProxy(string) FpToken
		SetEapStorage(string) FpToken
		SetRiskLock(string) FpToken
		SetRegistry(string) FpToken
		SetCdpManager(string) FpToken
		SetStableToken(string) FpToken
	}

	fpToken struct {
		Contract
		manage      string // address of Management
		manageProxy string // address of ManagementProxy
		eapStorage  string // address of EapStorage
		riskLock    string // address of TokenRiskLock
		registry    string // address of Registry
		cdp         string // address of CdpManager
		stbToken    string // address of stable token
	}
)

// NewFpToken creates a new FpToken
func NewFpToken(exp string) FpToken {
	return &fpToken{Contract: NewContract(exp)}
}

func (f *fpToken) CreateToken(id, debtor, creditor string, total, risk, open, exp int64) (string, error) {
	addrDebtor, err := address.FromString(debtor)
	if err != nil {
		return "", errors.Errorf("invalid debtor address = %s", debtor)
	}
	addrCreditor, err := address.FromString(creditor)
	if err != nil {
		return "", errors.Errorf("invalid creditor address = %s", creditor)
	}

	h, err := f.RunAsOwner().
		SetAddress(f.manageProxy).
		Call("5582e770",
			[]byte(id),
			addrDebtor.Bytes(),
			addrCreditor.Bytes(),
			big.NewInt(total).Bytes(),
			big.NewInt(risk).Bytes(),
			big.NewInt(open).Bytes(),
			big.NewInt(exp).Bytes())
	if err != nil {
		return h, errors.Wrapf(err, "call failed to create fp token %s", id)
	}

	if _, err := f.CheckCallResult(h); err != nil {
		return h, errors.Wrapf(err, "check failed to create fp token %s", id)
	}
	return h, nil
}

func (f *fpToken) CreateDeferredToken(creditor, prvkey, source, deferred string, amount, open, exp int64) (string, error) {
	addrCreditor, err := address.FromString(creditor)
	if err != nil {
		return "", errors.Errorf("invalid creditor address = %s", creditor)
	}
	srcToken, err := address.FromString(source)
	if err != nil {
		return "", errors.Errorf("invalid token address = %s", source)
	}
	addrProxy, _ := address.FromString(f.manageProxy)

	h, err := f.SetExecutor(creditor).
		SetPrvKey(prvkey).
		SetAddress(f.manage).
		Call("a22cb465", addrProxy.Bytes(), []byte{1})
	if err != nil {
		return h, errors.Wrap(err, "creditor failed to set approve")
	}
	time.Sleep(time.Millisecond * 200)

	h, err = f.RunAsOwner().
		SetAddress(f.manageProxy).
		Call("f5f8644e",
			addrCreditor.Bytes(),
			srcToken.Bytes(),
			big.NewInt(amount).Bytes(),
			[]byte(deferred),
			big.NewInt(open).Bytes(),
			big.NewInt(exp).Bytes())
	if err != nil {
		return h, errors.Wrapf(err, "call failed to create deferred token %s", deferred)
	}

	if _, err := f.CheckCallResult(h); err != nil {
		return h, errors.Wrapf(err, "check failed to create deferred token %s", deferred)
	}
	return h, nil
}

func (f *fpToken) TokenAddress(astid string) (string, error) {
	// call Management.tokenById() to get the asset's ERC20 token address
	res, err := f.RunAsOwner().SetAddress(f.manage).Read("6b6af2d5", []byte(astid))
	if err != nil {
		return "", errors.Wrapf(err, "failed to get token address for asset %s", astid)
	}
	data, err := hex.DecodeString(res)
	if err != nil {
		return "", errors.Wrap(err, "invalid token address")
	}
	addr := hash.BytesToHash160(data)
	if (hash.Hash160{} == addr) {
		// tokenById() returns an all-zero address, sth must go wrong
		return "", errors.Errorf("all-zero token address")
	}
	// tokenById() returns 20-byte EVM address, convert to iotex address
	token, _ := address.FromBytes(addr[:])
	return token.String(), nil
}

func (f *fpToken) Transfer(token, sender, prvkey, receiver string, amount int64) (string, error) {
	_, err := address.FromString(sender)
	if err != nil {
		return "", errors.Errorf("invalid account address = %s", sender)
	}
	addrReceiver, err := address.FromString(receiver)
	if err != nil {
		return "", errors.Errorf("invalid account address = %s", receiver)
	}
	// transfer to receiver
	h, err := f.SetAddress(token).
		SetExecutor(sender).
		SetPrvKey(prvkey).
		Call("a9059cbb", addrReceiver.Bytes(), big.NewInt(amount).Bytes())
	if err != nil {
		return h, errors.Wrap(err, "call transfer failed")
	}

	if _, err := f.CheckCallResult(h); err != nil {
		return h, errors.Wrap(err, "check transfer failed")
	}
	return h, nil
}

func (f *fpToken) RiskLock(token, sender, prvkey string, amount int64) (string, error) {
	// lock is a special type of transfer with receiver == risk lock contract
	return f.Transfer(token, sender, prvkey, f.riskLock, amount)
}

func (f *fpToken) SetRate(source string, amount int64) (string, error) {
	tokenAddr := []byte{}
	if source != StableTokenID {
		token, err := address.FromString(source)
		if err != nil {
			return "", errors.Errorf("invalid token address = %s", source)
		}
		tokenAddr = token.Bytes()
	}
	h, err := f.RunAsOwner().
		SetAddress(f.cdp).
		Call("9fb9c12c", tokenAddr, big.NewInt(amount).Bytes())
	if err != nil {
		return h, errors.Wrap(err, "call set interest rate failed")
	}

	if _, err := f.CheckCallResult(h); err != nil {
		return h, errors.Wrap(err, "check set interest rate failed")
	}
	return h, nil
}

func (f *fpToken) GetRate(token string) (string, error) {
	return f.ReadAndParseToDecimal(f.cdp, "2e05d56f", token)
}

func (f *fpToken) SetPayDate(token string, pay int64) (string, error) {
	tokenAddr, err := address.FromString(token)
	if err != nil {
		return "", errors.Errorf("invalid token address = %s", token)
	}
	h, err := f.RunAsOwner().
		SetAddress(f.eapStorage).
		Call("b74b15a6", tokenAddr.Bytes(), big.NewInt(pay).Bytes())
	if err != nil {
		return h, errors.Wrap(err, "call setPayDate failed")
	}

	if _, err := f.CheckCallResult(h); err != nil {
		return h, errors.Wrap(err, "check setPayDate failed")
	}
	return h, nil
}

func (f *fpToken) GetPayDate(token string) (string, error) {
	return f.ReadAndParseToDecimal(f.eapStorage, "8174bc65", token)
}

func (f *fpToken) Start() error {
	addrManage, err := address.FromString(f.manage)
	if err != nil {
		return errors.Errorf("invalid management contract address = %s", f.manage)
	}
	addrProxy, err := address.FromString(f.manageProxy)
	if err != nil {
		return errors.Errorf("invalid management proxy contract address = %s", f.manageProxy)
	}
	addrEap, err := address.FromString(f.eapStorage)
	if err != nil {
		return errors.Errorf("invalid storage contract address = %s", f.eapStorage)
	}
	addrRiskLock, err := address.FromString(f.riskLock)
	if err != nil {
		return errors.Errorf("invalid risk lock contract address = %s", f.riskLock)
	}
	addrReg, err := address.FromString(f.registry)
	if err != nil {
		return errors.Errorf("invalid registry contract address = %s", f.registry)
	}
	addrCdp, err := address.FromString(f.cdp)
	if err != nil {
		return errors.Errorf("invalid cdp management contract address = %s", f.cdp)
	}
	admin, err := address.FromString(Producer)
	if err != nil {
		return errors.Errorf("invalid admin address = %s", Producer)
	}

	// set-up management
	h, err := f.RunAsOwner().SetAddress(f.manage).Call("f0bc1c2b", addrEap.Bytes())
	if err != nil {
		return errors.Wrap(err, "management contract failed to set storage")
	}
	time.Sleep(time.Millisecond * 100)

	h1, err := f.Call("083b6b8a", addrRiskLock.Bytes())
	if err != nil {
		return errors.Wrap(err, "management contract failed to set risk lock")
	}
	time.Sleep(time.Millisecond * 100)

	h2, err := f.Call("a91ee0dc", addrReg.Bytes())
	if err != nil {
		return errors.Wrap(err, "management contract failed to set registry")
	}
	time.Sleep(time.Millisecond * 100)

	h3, err := f.Call("f2fde38b", addrProxy.Bytes())
	if err != nil {
		return errors.Wrap(err, "management contract failed to transfer ownership")
	}
	time.Sleep(time.Millisecond * 100)

	res, err := f.Read("121d8fdd", nil)
	if err != nil {
		return errors.Wrap(err, "management contract failed to get CAN_BURN()")
	}
	canBurn, err := hex.DecodeString(res)
	if err != nil {
		return errors.Wrapf(err, "invalid CAN_BURN bytes")
	}
	if len(canBurn) != 32 {
		return errors.Errorf("invalid CAN_BURN bytes length = %d, expecting 32", len(canBurn))
	}
	res, err = f.Read("eb222d67", nil)
	if err != nil {
		return errors.Wrap(err, "management contract failed to get ON_RECEIVED()")
	}
	onReceived, err := hex.DecodeString(res)
	if err != nil {
		return errors.Wrapf(err, "invalid ON_RECEIVED bytes")
	}
	if len(onReceived) != 32 {
		return errors.Errorf("invalid ON_RECEIVED bytes length = %d, expecting 32", len(onReceived))
	}

	// set-up risk lock
	h4, err := f.SetAddress(f.riskLock).Call("50aaf8b8", addrEap.Bytes())
	if err != nil {
		return errors.Wrap(err, "risk lock contract failed to set storage")
	}
	time.Sleep(time.Millisecond * 100)

	// set-up storage
	h5, err := f.SetAddress(f.eapStorage).Call("4b0bddd2", addrProxy.Bytes(), []byte{1})
	if err != nil {
		return errors.Wrap(err, "storage contract failed to set admin")
	}
	time.Sleep(time.Millisecond * 100)

	// set-up proxy
	h6, err := f.SetAddress(f.manageProxy).Call("50aaf8b8", addrEap.Bytes())
	if err != nil {
		return errors.Wrap(err, "proxy contract failed to set storage")
	}
	time.Sleep(time.Millisecond * 100)

	h7, err := f.Call("d4a22bde", addrManage.Bytes())
	if err != nil {
		return errors.Wrap(err, "proxy contract failed to set management")
	}
	time.Sleep(time.Millisecond * 100)

	h8, err := f.Call("c254f696", addrCdp.Bytes())
	if err != nil {
		return errors.Wrap(err, "proxy contract failed to set cdp management")
	}
	time.Sleep(time.Millisecond * 100)

	// set up registry
	h9, err := f.SetAddress(f.registry).Call("fdac9ff7", admin.Bytes(), canBurn, []byte{1})
	if err != nil {
		return errors.Wrap(err, "registry failed to set CAN_BURN")
	}
	time.Sleep(time.Millisecond * 100)

	h10, err := f.Call("fdac9ff7", addrRiskLock.Bytes(), onReceived, []byte{1})
	if err != nil {
		return errors.Wrap(err, "registry failed to set ON_RECEIVED")
	}
	time.Sleep(time.Millisecond * 100)

	// set-up cdp management
	h11, err := f.SetAddress(f.cdp).Call("50aaf8b8", addrEap.Bytes())
	if err != nil {
		return errors.Wrap(err, "cdp management contract failed to set storage")
	}
	time.Sleep(time.Millisecond * 100)

	h12, err := f.Call("b5524206", addrProxy.Bytes())
	if err != nil {
		return errors.Wrap(err, "cdp management contract failed to set proxy")
	}
	time.Sleep(time.Millisecond * 100)

	h13, err := f.Call("deaa59df", admin.Bytes())
	if err != nil {
		return errors.Wrap(err, "cdp management contract failed to set wallet")
	}
	time.Sleep(time.Millisecond * 100)

	// set-up stable token approve
	approve := hash.Hash256{}
	for i := 0; i < len(approve); i++ {
		approve[i] = 255
	}
	h14, err := f.SetAddress(f.stbToken).Call("095ea7b3", addrCdp.Bytes(), approve[:])
	if err != nil {
		return errors.Wrap(err, "call stable token contract failed to set approve")
	}

	if _, err := f.CheckCallResult(h); err != nil {
		return errors.Wrap(err, "check management contract failed to set storage")
	}
	if _, err := f.CheckCallResult(h1); err != nil {
		return errors.Wrap(err, "check management contract failed to set risk lock")
	}
	if _, err := f.CheckCallResult(h2); err != nil {
		return errors.Wrap(err, "check management contract failed to set registry")
	}
	if _, err := f.CheckCallResult(h3); err != nil {
		return errors.Wrap(err, "check management contract failed to transfer ownership")
	}
	if _, err := f.CheckCallResult(h4); err != nil {
		return errors.Wrap(err, "check risk lock contract failed to set storage")
	}
	if _, err := f.CheckCallResult(h5); err != nil {
		return errors.Wrap(err, "storage contract failed to set admin")
	}
	if _, err := f.CheckCallResult(h6); err != nil {
		return errors.Wrap(err, "check proxy contract failed to set storage")
	}
	if _, err := f.CheckCallResult(h7); err != nil {
		return errors.Wrap(err, "check proxy contract failed to set management")
	}
	if _, err := f.CheckCallResult(h8); err != nil {
		return errors.Wrap(err, "check proxy contract failed to set cdp management")
	}
	if _, err := f.CheckCallResult(h9); err != nil {
		return errors.Wrap(err, "check registry contract failed to set CAN_BURN")
	}
	if _, err := f.CheckCallResult(h10); err != nil {
		return errors.Wrap(err, "check registry contract failed to set ON_RECEIVED1")
	}
	if _, err := f.CheckCallResult(h11); err != nil {
		return errors.Wrap(err, "check cdp management contract failed to set storage")
	}
	if _, err := f.CheckCallResult(h12); err != nil {
		return errors.Wrap(err, "check cdp management contract failed to set proxy")
	}
	if _, err := f.CheckCallResult(h13); err != nil {
		return errors.Wrap(err, "check cdp management contract failed to set wallet")
	}
	if _, err := f.CheckCallResult(h14); err != nil {
		return errors.Wrap(err, "check stable token contract failed to set approve")
	}
	return nil
}

func (f *fpToken) SetManagement(manage string) FpToken {
	f.manage = manage
	return f
}

func (f *fpToken) SetManagementProxy(proxy string) FpToken {
	f.manageProxy = proxy
	return f
}

func (f *fpToken) SetEapStorage(eap string) FpToken {
	f.eapStorage = eap
	return f
}

func (f *fpToken) SetRiskLock(lock string) FpToken {
	f.riskLock = lock
	return f
}

func (f *fpToken) SetRegistry(reg string) FpToken {
	f.registry = reg
	return f
}

func (f *fpToken) SetCdpManager(cdp string) FpToken {
	f.cdp = cdp
	return f
}

func (f *fpToken) SetStableToken(stb string) FpToken {
	f.stbToken = stb
	return f
}
